const Index = ({data}) => {
  return(
        <div>
          <head>
            <title>Welcome</title>
          </head>
          <Layout>
            <h1>Welcome To my next Tuto</h1>
            <p>Okkkk</p>
          </Layout>
        </div>
      )
};

export default () => Index;
